const axios = require('axios');

const apiToken = 'UcY7RIsoOUblEZ5NGJ97TS0qjRMdJfE0IyuytK4UtAyRAeGUJkCA127E6wcB';

export class API {

    static handleDataRequestsAPI = request => {  

        const requestList = ['SPY','DJI','RUS','NDX','TSLA'];
        console.log(requestList.join(','))
        let finalRequest = `https://api.worldtradingdata.com/api/v1/stock?symbol=${requestList}&api_token=${apiToken}`

        return axios.get('https://api.worldtradingdata.com/api/v1/stock?symbol=SPY,DJI,RUS,NDX,TSLA&api_token=UcY7RIsoOUblEZ5NGJ97TS0qjRMdJfE0IyuytK4UtAyRAeGUJkCA127E6wcB')
                        .then(response => response.data.data);
    }

}
